                    <img class="inner-img" src={ pic1 } style={{width: '500px', height: '300px', paddingLeft: '30px'}}/>
                    {/* <img class="inner-img" src={ pic2 } align="right"/> */}
                </div>
                <HomePageSlider />
                
            </div>
            
        )
}
    
     
    export default Home;
